    var result = [];
    window.onload = function() {
      if (typeof Android != 'undefined') {
        Android.debugMode(true);
        Android.getContactPotentials('getContactPotentialCallback');
      }
    };
    var getContactPotentialCallback = function(jsonString) {
      var jsonArray = JSON.parse(jsonString);
      result = new Array(jsonArray.length);
      for (var i = 0; i < jsonArray.length; i++) {
        result[i] = {
          index: jsonArray[i].index,
          name: jsonArray[i].name,
          potential: jsonArray[i].potential,
          planCount: jsonArray[i].planCount,
          factCount: jsonArray[i].factCount
        };
      }
    };

    /* 1 */

    var style_el = document.createElement('style'),
      slider_el = document.querySelector('input[type="range"]'),
      pp = ['-webkit-slider-runnable-', '-moz-range-'],
      n_pp = pp.length;

    document.body.appendChild(style_el);

    slider_el.addEventListener('input', function() {
      var val = this.value + '% 100%,' + this.value + '% 100%,100% 100%',
        sel = '.js input[type="range"]',
        str = sel + ' /deep/ #thumb:before{content:"' + this.value + '%"}';

      for (var i = 0; i < n_pp; i++) {
        str += sel + '::' + pp[i] + 'track{background-size:' + val + '}';
      }

      style_el.textContent = str;
    }, false);

    const num = document.getElementById('num');
    const range = document.getElementById('range');

    const set = val => {
      num.value = val;
      range.value = val;

    range.addEventListener('change', () => {
      if (typeof Android !== 'undefined') Android.saveCLMAnswer(690, "Потенциал", range.value);

    num.addEventListener('change', () => set(num.value));
